@Rob's Rules In those recordings Amber's behavior is consistent with a cluster b, Borderline Personality Disorder  diagnosis. Common cluster b disorders are Narcissistic Personality Disorder (they can also "just" have have traits from more than one cluster b Disorder). Here's a description of Antisocial Personality Disorder copied from Psychology Today,

Antisocial personality disorder describes a pattern of behavior in which an individual regularly violates the physical or emotional rights of others; behaves recklessly, violently, or deceitfully; and lacks remorse for any harm caused to others.

This beast should have been made to have a full psych evaluation, and only to be fair, so should Johnny. Johnny shows traits of codependency due to trauma bonding, which is common in people who have been abused as children, in Johnny's case his mother which makes sense. The textbook "people pleaser" who puts the needs of others above their own. There is no intended negative association with the term people pleaser, it can have negative consequences but it's not a bad thing. Lawyers and Barristers are pretty knowledgeable about these types because they often find themselves on the wrong side of the law. I'm not an expert but I have personal experience and have read up on it and learnt a lot from Les @Spiritually Empowered! Most often but not always it's young men who have this disorder and appear in court so the judge may have missed it in Amber. If she had a typical fit of BDP rage that would have been obvious but she was, on the days on the stand, able to somewhat contain her contempt, and anger although it was probably as visible as it was in her deposition! Her coming across as self absorbed and unable to take any accountability may have been viewed by the judge as just her generation's personality (the selfie generation in an old man's brain is probably considered self absorbed).

